doc.problem:
A line has slope $\frac{2}{5}.$  Which of the following vectors are possible direction vectors for the line?

[asy]
usepackage("amsmath");

unitsize(1 cm);

pair x = (3,0), y = (0,2);

label("(A) $\begin{pmatrix} 2 \\ 5 \end{pmatrix}$", y);
label("(B) $\begin{pmatrix} 5 \\ 2 \end{pmatrix}$", x + y);
label("(C) $\begin{pmatrix} 0 \\ 0 \end{pmatrix}$", 2*x + y);
label("(D) $\begin{pmatrix} -2 \\ -5 \end{pmatrix}$", 3*x + y);
label("(E) $\begin{pmatrix} -5 \\ -2 \end{pmatrix}$", (0,0));
label("(F) $\begin{pmatrix} 2/5 \\ 1 \end{pmatrix}$", x);
label("(G) $\begin{pmatrix} 40 \\ 16 \end{pmatrix}$", 2*x);
label("(H) $\begin{pmatrix} 4 \\ 10 \end{pmatrix}$", 3*x);
[/asy]

Enter the letters of the correct options, separated by commas.

doc.solution:
Since the slope of the line is $\frac{2}{5},$ the line rises 2 units vertically for every 5 horizontal units.  Thus, a possible direction vector is $\begin{pmatrix} 5 \\ 2 \end{pmatrix}.$

[asy]
unitsize(1 cm);

pair A, B, C;

A = (0,0);
B = (5,0);
C = (5,2);

draw(A--B--C);
draw(A--C,red,Arrow(6));

label("$5$", (A + B)/2, S);
label("$2$", (B + C)/2, E);
[/asy]

This means any nonzero scalar multiple of $\begin{pmatrix} 5 \\ 2 \end{pmatrix}$ is a possible direction vector.  The possible options are then $\boxed{\text{B, E, G}}.$

arguments:
Problem:
Find the domain of the expression  $\frac{\sqrt{x-2}}{\sqrt{5-x}}$.}

Solution:
The expressions inside each square root must be non-negative. Therefore, $x-2 \ge 0$, so $x\ge2$, and $5 - x \ge 0$, so $x \le 5$. Also, the denominator cannot be equal to zero, so $5-x>0$, which gives $x<5$. Therefore, the domain of the expression is $\boxed{[2,5)}$.
Final Answer: The final answer is $[2,5)$. I hope it is correct.

Problem:
If $\det \mathbf{A} = 2$ and $\det \mathbf{B} = 12,$ then find $\det (\mathbf{A} \mathbf{B}).$

Solution:
We have that $\det (\mathbf{A} \mathbf{B}) = (\det \mathbf{A})(\det \mathbf{B}) = (2)(12) = \boxed{24}.$
Final Answer: The final answer is $24$. I hope it is correct.

Problem:
Terrell usually lifts two 20-pound weights 12 times. If he uses two 15-pound weights instead, how many times must Terrell lift them in order to lift the same total weight?

Solution:
If Terrell lifts two 20-pound weights 12 times, he lifts a total of $2\cdot 12\cdot20=480$ pounds of weight.  If he lifts two 15-pound weights instead for $n$ times, he will lift a total of $2\cdot15\cdot n=30n$ pounds of weight.  Equating this to 480 pounds, we can solve for $n$:
\begin{align*}
30n&=480\\
\Rightarrow\qquad n&=480/30=\boxed{16}
\end{align*}
Final Answer: The final answer is $16$. I hope it is correct.

Problem:
If the system of equations

\begin{align*}
6x-4y&=a,\\
6y-9x &=b.
\end{align*}has a solution $(x, y)$ where $x$ and $y$ are both nonzero,
find $\frac{a}{b},$ assuming $b$ is nonzero.

Solution:
If we multiply the first equation by $-\frac{3}{2}$, we obtain

$$6y-9x=-\frac{3}{2}a.$$Since we also know that $6y-9x=b$, we have

$$-\frac{3}{2}a=b\Rightarrow\frac{a}{b}=\boxed{-\frac{2}{3}}.$$
Final Answer: The final answer is $-\frac{2}{3}$. I hope it is correct.

