Let $r$ be the radius of the sphere, and let $I$ be the center of the sphere.  We see that
\[[ABCD] = \frac{1}{3} \cdot [ABD] \cdot CD = \frac{1}{3} \cdot \frac{1}{2} \cdot 4 \cdot 6 \cdot 2 = 8.\]We can also write
\[[ABCD] = [ABCI] + [ABDI] + [ACDI] + [BCDI].\]We can view tetrahedron with base $ABCI$ with base $ABC$ and height $r,$ so
\[[ABCI] = \frac{1}{3} \cdot 14 \cdot r = \frac{14}{3} r.\]Similarly,
\begin{align*}
[ABDI] &= \frac{1}{3} \cdot 12 \cdot r = 4r, \\
[ACDI] &= \frac{1}{3} \cdot 6 \cdot r = 2r, \\
[BCDI] &= \frac{1}{3} \cdot 4 \cdot r = \frac{4}{3} r.
\end{align*}Thus,
\[\frac{14}{3} r + 4r + 2r + \frac{4}{3} r = 8.\]Solving for $r,$ we find $r = \boxed{\frac{2}{3}}.$

